import "./image/search.png";
import "./style.css";
const Home = () => {
  return (
    <div className="container">
      <div className="weather">
        <div className="search">
          <input type="text" placeholder="Введите название города"></input>
          <button>
            <img src="./image/search.png"></img>
          </button>
        </div>
        <div className="winfo"></div>
      </div>
    </div>
  );
};

export default Home;
